import { useState } from 'react'
import './Form.css'
export default function Form({ }) {
    function handleOnChange(ev) {
        const [datax, setVal] = useState(ev.target.value)
        setVal(ev.target.value)
        console.log(ev.target.value)
    }
    return (
        <div className="form-div">
            <h1>{datax}</h1>
            <form>
                <input type="text" onChange={(ev) => handleOnChange(ev)} />
                <input type="text" />
                <input type="submit" />
            </form>
        </div>
    )
}
